import React from "react";
function FeatureValue(props){
    const customStyle={
        width: "150px",
        height:"150px"
    }
    const contentStyle={
        textAlign:"center",
        fontSize:"2rem"
    }
    return (
        <div>
            <img src={props.imgsrc} style={customStyle} />
            <h3>{props.content} style={contentStyle}</h3>
        </div>
    )
}
export default FeatureValue;
